                          aura_env.spells[id] = data.sound\
                          if C_UnitAuras.AuraIsPrivate(id) then\
                              -- print(i, C_Spell.GetSpellInfo(i).name)\
                              C_UnitAuras.AddPrivateAuraAppliedSound({\
                                      unitToken = aura_env.config.unit,\
                                      spellID = id,\
