          ["custom"] = "function(s, e, ...)\
       if e == \"OPTIONS\" then        \
           s[\"\"] = {\
               show = true,\
               changed = true,\
               progressType = \"timed\",\
               cname = NSAPI:Shorten(\"player\", 8),  \
               duration = 7,\
               expirationTime = 7+GetTime(),\
               autoHide = true,\
           }\
           return true       \
       end\
       local u, cast, spellID = ... -- Unit event\
       if e == \"UNIT_SPELLCAST_START\" and spellID == 1224812 then\
           aura_env.spellSequence = aura_env.spellSequence + 1    \
           if (aura_env.spellSequence == 5) then aura_env.spellSequence = 1 end\
           return true\
       end\
       if e == \"UNIT_SPELLCAST_START\" and spellID == 1224787 then\
           aura_env.count = aura_env.count+1\
           aura_env.spellSequence = aura_env.spellSequence + 1    \
           if (aura_env.spellSequence == 5) then aura_env.spellSequence = 1 end\
           if aura_env.count == 3 then aura_env.count = 1 end\
           local expires = select(5, UnitCastingInfo(u))\
           s[UnitGUID(u)] = {\
               show = true,\
               changed = true,\
               progressType = \"timed\",\
               count = aura_env.count,\
               spellSequence = aura_env.spellSequence,\
               cname = UnitExists(u..\"target\") and NSAPI:Shorten(u..\"target\", 8),                \
               icon = C_Spell.GetSpellInfo(spellID).iconID,\
               duration = (expires/1000)-GetTime(),\
               expirationTime = expires/1000,\
               autoHide = true,\
           }\
           return true         \
       end\
       if e == \"UNIT_SPELLCAST_STOP\" then\
           local u, cast, spellID = ... -- Unit event\
           local G = UnitGUID(u)\
           if s[G] then\
               s[G].show = false\
               s[G].changed = true\
               return true\
           end\
       end\
       return true\
   end    \
