          ["custom"] = "function(s, e, ...)\
          if e == \"OPTIONS\" then\
              local state1 = {\
                  progressType = \"static\",\
                  value = math.random(2000000, 80000000),\
                  total = 100000000,\
                  ignorepos = true,\
                  index = 1,\
                  spark = false,\
                  autoHide = true,\
              }\
              local state2 = {\
                  progressType = \"timed\",\
                  duration = 10,\
                  expirationTime = 10+GetTime(),\
                  spark = true,\
                  index = 2,\
                  autoHide = true,\
              }\
              s:Update(1, state1)\
              s:Update(2, state2)\
          else\
              if e == \"TRIGGER\" then            \
                  local triggerNum, triggerStates = ...  \
                  if triggerNum == 2 then\
                      for k, v in pairs(triggerStates) do\
                          local state = {\
                              progressType = \"static\",\
                              value = v.health,\
                              total = v.maxhealth, \
                              ignorepos = true,\
                              index = 1,\
                              autoHide = true,\
                          }\
                          s:Update(1, state)\
                      end               \
                      \
                  elseif triggerNum == 3 and triggerStates[\"\"] then\
                      if s[2] then -- already have bossmod information\
                          local newexpire = triggerStates[\"\"].expirationTime\
                          local diff = newexpire-s[2].expirationTime -- figure out the difference from the initial duration                    \
                          s[2].duration = s[2].duration+diff              \
                          s[2].expirationTime = newexpire\
                          s[2].changed = true\
                          return true\
                      else\
                          local state = {\
                              progressType = \"timed\",\
                              duration = triggerStates[\"\"].duration,\
                              expirationTime = triggerStates[\"\"].expirationTime,\
                              index = 2,\
                              spark = true,\
                              autoHide = true,\
                          }\
                          s:Update(2, state)   \
                      end             \
                  end\
              end\
          end\
      end",
